sys_variable_value.value:
(function execute(inputs, outputs) {
  var valueRange = {};
  valueRange.majorDimension = 'COLUMNS';
  valueRange.range = 'B3:B4';
  valueRange.values = [[inputs.miles,inputs.tier]];
  outputs.valuerange = JSON.stringify(valueRange);
})(inputs, outputs);

